  

'use strict';

// MODULES //

var NAMESPACE = require( './../namespace.js' );
var logger = require( './../console.js' );


// MAIN //

/**
* Prints the list of namespace aliases.
*
* @private
*/
function namespace() {
	var i;
	for ( i = 0; i < NAMESPACE.length; i++ ) {
		logger.log( NAMESPACE[ i ].alias );
	}
}


// EXPORTS //

module.exports = namespace;
